import style from './card.module.css';

export default function Card(props) {
   return (
      <div className={style.characterImage}>
        <button className={style.closeButton} onClick={props.onClose}>X</button>
         <h2>{props.name}</h2>
         <h2>{props.status}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin.name}</h2>
         <img className={style.imageContainer}
         src={props.image} alt='' /> 
      </div>
   );
}
